import React from 'react'
import PostListItem from '../post-list-item/post-list-item'
const PostList = ({props}) => {

   return (
    <ul className = "app-list list-group">
          <PostListItem label={props[0].label} important={props[0].important}></PostListItem>
          <PostListItem label={props[1].label} important={props[1].important}></PostListItem>
          <PostListItem label={props[2].label} important={props[2].important}></PostListItem>

   </ul>
   )
} 
export default PostList;
